import styled from "styled-components";
import {livros} from "../../dadosPesquisa.js";

function UltimosLancamentos() {
  return (
    <section>
      <h2>ULTIMOS LANCAMENTOS</h2>
      {livros.map( livro => (
        <img src={livro.src}/>
      ))}
    </section>
      
  )
}

export default UltimosLancamentos;
